import { useSelector, useDispatch } from "react-redux";
import { useEffect } from "react"
import { Link, useNavigate } from "react-router-dom";
import React from "react";
import OrderPageItem from "../components/OrderPageItem";
import NotFoundPage from "../components/NotFoundPage";
import { useState } from "@types/react";


const Orders = () => {
  const user = useSelector((state) => state.user);
  const navigate = useNavigate()
  const [sum,setSum] = useState(0);

  const getTotalPrice = () => {
    if(order.orderedProducts.length > 0) {
      let newSum = 0
      order.orderedProducts.map(i => newSum += (i.count * i.price))
      setSum(newSum)
      newSum = 0
    }
    else {
      setSum(0)
    }

  }
  useEffect(() => {
    !user.sessionData.loggedIn ? navigate("/login") : console.log()
  })

  //all code
  if(user.sessionData.loggedIn) {
    console.log("true");
  }
  console.log(user.users[user.sessionData.email].orders.length === 0);
  return (
    <div className="orders">
      {user.users[user.sessionData.email].orders.length === 0 ? <NotFoundPage link={"/"} text={"You don't have any orders"} /> : null }
      {user.sessionData.loggedIn ?
       <div className={"ordersPage"}>{user.users[user.sessionData.email].orders.map(i => <OrderPageItem totalPrice={sum} orderedDate={i.orderedDate} ID={i.ID} /> ) }</div>
        : <span></span> }
    </div>
  )

}

export default Orders
